func maxVowels(s string, k int) int {
	vowel_count := 0
	for i := range k {
		if is_vowel(rune(s[i])) {
			vowel_count++
		}
	}
	max_vowel_count := vowel_count
	for i := k; i < len(s); i++ {
		if is_vowel(rune(s[i-k])) {
			vowel_count--
		}
		if is_vowel(rune(s[i])) {
			vowel_count++
		}
		if vowel_count > max_vowel_count {
			max_vowel_count = vowel_count
		}
	}
	return max_vowel_count
}

